function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<LoginForm setToken={setToken} />} />
                {<PrivateRoute><Dashboard token={token}/></PrivateRoute>} />
            </Routes>
        </Router>
    );
}

export default App;
